            SeedTenants(context);
            SeedSettings(context);
            SeedBinaryObjects(context);
            SeedMailGroups(context);
            SeedUsers(context);
            SeedSettingsClient(context);
            SeedRoles(context);
            SeedUserRoles(context);
            SeedLanguages(context);
