        public static void SeedLanguageTexts(AlgoriaCoreDbContext context)
        {
            Language languageHost = context.Language.FirstOrDefault(p => p.TenantId == null && p.Name == "es-MX");
            Language languageTenantDefault = context.Language.FirstOrDefault(p => p.TenantId == 1 && p.Name == "es-MX");

            var languageTexts = new[]
            {
                new LanguageText { LanguageId = languageHost.Id, Key = "UPD", Value = "UPD" },
                new LanguageText { LanguageId = languageTenantDefault.Id, Key = "UPD", Value = "UPD" }
            };

            context.LanguageText.AddRange(languageTexts);

            context.SaveChanges();
        }

